@wdunlap @EvanAKilgore @marymac41 😡😆😡😆😡🤔😡😆
I am on the floor gasping for air &amp; alternatively howling out in laughter &amp; screaming out in rage.

None of the above is true. But I have a question: how would your lunatic governor know whether you are adhering to his dictum? I'd like to witness his T dinner.

@iTunes please stop adding terrible updates. I don't want my search view to be different from my song view. This is terrible UX design, and the fact that I can't view it as songs (like i can with playlists) is rage-inducing.

Sincerely,

Probably everyone
